def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []
    deleted_items: List[np.ndarray] = []
    split_items: List[np.ndarray] = []
    split_frames: List[DataFrame] = []

    no_result = object()
    for block in data.blocks:
        # Additional check for data consistency
        if not block or not block.mrg_locs:
            continue

        result = no_result
        locs = block.mgr_locs
        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
        except NotImplementedError as e:
            if alt is None:
                assert how == "ohlc"
                deleted_items.append(locs)
                continue
            else:
                # handle alternative aggregation method
                result = self._handle_alternative_aggregation(block.values, alt)

        if result is not no_result:
            result = self._maybe_cast_block_result(result, block.dtype)
            agg_block = block.make_block(result)
            new_items.append(locs)
            agg_blocks.append(agg_block)

    if not (agg_blocks or split_frames):
        raise DataError("No numeric types to aggregate")

    if split_items:
        self._clean_up_split_blocks(split_items, split_frames, new_items, agg_blocks)

    indexer = self._reset_blocks_indexer(new_items)

    if deleted_items:
        indexer = self._adjust_indexer_for_deleted_items(data, deleted_items, indexer)

    return agg_blocks, data.items.take(np.sort(indexer))
